import { BrowserRouter as 
Router,
Route,
Link,
Switch,
Redirect 
}
from 'react-router-dom';



function App() {
  return (
    <Router>
     <NavBar />
    <Switch>

    <div className="App">
      <header className="App-header">
       <Login1 />
      </header>
    </div>  
   <div className='container'>
   <Route to="/notFound" component={notFound}/>
    </div>
    </Switch>
  </Router>


  );
}


export default App;
